import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import ProductItem from "../utils/ProductItem/ProductItem";
import { pageSearch } from "../../../Redux/ProductRedux/actionProduct";
import { useLocation } from "react-router-dom";
import { v4 as uuid4 } from "uuid";
const PageSearch = () => {
    const { search } = useLocation();
    console.log(search);
    const { isLoad, error, products } = useSelector((state) => state.products);
    const dispatch = useDispatch();

    useEffect(() => {
        dispatch(pageSearch(search));
    }, []);

    return (
        <div className="grid wide">
            <div className="row container-mid">
                <div className="col mid-product l-2-5">
                    {products.map((item) => (
                        <ProductItem item={item} key={uuid4()} />
                    ))}
                </div>
            </div>
        </div>
    );
};

export default PageSearch;
